import React from "react";
import { Carousel } from "react-responsive-carousel";
import logo1 from "../assets/cpp.png";
import logo2 from "../assets/c.png";
import logo3 from "../assets/python.png";
import logo4 from "../assets/r.png";
import logo5 from "../assets/matlab.png";
import logo6 from "../assets/arduino.png";
import logo7 from "../assets/ltspice.png";

const Skills = () => {
  return (
    <>
      <div className="title">
        <h1>Skills</h1>
      </div>
      <div className="skills-carousel">
        <Carousel autoPlay linear infiniteLoop transitionTime={0.2}>
          <div>
            <img src={logo1} alt="" />
          </div>
          <div>
            <img src={logo2} alt="" />
          </div>
          <div>
            <img src={logo3} alt="" />
          </div>
          <div>
            <img src={logo4} alt="" />
          </div>
          <div>
            <img src={logo5} alt="" />
          </div>
          <div>
            <img src={logo6} alt="" />
          </div>
          <div>
            <img src={logo7} alt="" />
          </div>
        </Carousel>
      </div>
    </>
  );
};

export default Skills;
